import React from "react";
import { Routes, Route } from 'react-router-dom';
import Layout from './carpetilla/layout';

function App(){
    return (
      <Routes>
        <Route path="/" element={<Layout />} />
        element: <div></div>
      </Routes>
    );
}

export default App;
